IF OBJECT_ID('dbo.proc_transform_159', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_159;
GO
CREATE PROCEDURE dbo.proc_transform_159
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_159
    SET payload = LEFT(payload, 1000) + N'|V4-159|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_159;
END
